let currentQuestionIndex = 0;
let totalScore = 0;

const quizContainer = document.getElementById("quizContainer");
const questionImage1 = document.getElementById("questionImage1");
const questionImage2 = document.getElementById("questionImage2");
const questionText = document.getElementById("questionText");
const optionsContainer = document.getElementById("optionsContainer");
const resultText = document.getElementById("result");

function loadQuestion() {
  const currentQuestion = quizData[currentQuestionIndex];
  questionImage1.src = currentQuestion.image1;
  questionImage2.src = currentQuestion.image2;
  questionText.textContent = currentQuestion.question;
  optionsContainer.innerHTML = "";
  
  currentQuestion.options.forEach(option => {
    const button = document.createElement("button");
    button.textContent = option.letter.toUpperCase() + ". " + option.text;
    button.onclick = () => checkAnswer(option);
    optionsContainer.appendChild(button);
  });
}

function checkAnswer(selectedOption) {
  totalScore += selectedOption.score;
  // Opzionale: aggiungi un piccolo delay per dare feedback all'utente
  setTimeout(() => {
    currentQuestionIndex++;
    if (currentQuestionIndex < quizData.length) {
      loadQuestion();
    } else {
      showResults();
    }
  }, 300); // 300ms di delay; puoi impostarlo a 0 se non vuoi alcun ritardo
}

function showResults() {
  // Nascondiamo gli elementi del quiz
  document.querySelector('.images').classList.add("hidden");
  questionText.classList.add("hidden");
  optionsContainer.classList.add("hidden");

  // Visualizziamo il punteggio ottenuto
  resultText.textContent = `Hai ottenuto ${totalScore} punti su ${quizData.length * 3} possibili!`;
  resultText.classList.remove("hidden");

  // Determiniamo il profilo in base al punteggio
  let selectedProfile = null;
  for (let profile of profiles) {
    if (totalScore >= profile.min && totalScore <= profile.max) {
      selectedProfile = profile;
      break;
    }
  }
  
  if (selectedProfile) {
    document.getElementById("profileTitle").textContent = selectedProfile.title;
    document.getElementById("profileImage").src = selectedProfile.image;
    document.getElementById("profileCaption").textContent = selectedProfile.caption;
    document.getElementById("resultProfile").classList.remove("hidden");
  }
}

// Avvio del quiz al click sul pulsante "Inizia il test"
document.getElementById("startButton").addEventListener("click", () => {
  document.getElementById("startContainer").classList.add("hidden");
  quizContainer.classList.remove("hidden");
  loadQuestion();
});